const NameEnter =()=>{
[userName, setName] = useState(', please tell me your name!');

    setName=(name)=>{
        userName=name
    }

    return (
        <div>
            <button variant='primary' >Save Username</button>
            <input></input>
            <div>
            Welcome {userName}
            </div>
        </div>
    );
}

export default NameEnter
